/*Table structure for table `subcategory` */

DROP TABLE IF EXISTS `subcategory`;

CREATE TABLE `subcategory` (
  `ID` bigint NOT NULL,
  `NAME` varchar(225) DEFAULT NULL,
  `DESCRIPTION` varchar(225) DEFAULT NULL,
  `CATEGORY_ID` bigint DEFAULT NULL,
  `CATEGORY_NAME` varchar(225) DEFAULT NULL,
  `IMAGE` longblob,
  `CREATED_BY` varchar(225) DEFAULT NULL,
  `MODIFIED_BY` varchar(225) DEFAULT NULL,
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL,
  `MODIFIED_DATETIME` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `CATEGORY_ID` (`CATEGORY_ID`),
  CONSTRAINT `subcategory_ibfk_1` FOREIGN KEY (`CATEGORY_ID`) REFERENCES `category` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

